import React from 'react';
import logo from './assets/logo.png';
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom';

export default function SideBar() {
  return (
    <div className="SideBar">
      <div className='logoDiv'>
        <img src={logo} alt="logo" />
      </div>
      <Link to="/home">
            <Button className='full-text'>Home</Button>
            <Button className='short-text'>H</Button>
          </Link>
          <Link to="/tictactoe">
            <Button className='full-text'>Tictac</Button>
            <Button className='short-text'>Ti</Button>
          </Link>
          <Link to="/tower">
            <Button className='full-text'>Tower</Button>
            <Button className='short-text'>To</Button>
          </Link>
          <Link to="/snek">
            <Button className='full-text'>Snek</Button>
            <Button className='short-text'>S</Button>
          </Link>
    </div>
  );
}
